import { boolean, text, withKnobs } from '@storybook/addon-knobs';
import React, { useState } from 'react';
import { action } from '@storybook/addon-actions';
import DataTable from './DataTable';

const columns = {
  id: {
    type: 'number',
    label: 'Id',
    key: true,
    sortForm: {
      id: {
        type: 'sort',
      },
    },
  },
  createdAtFormatted: {
    type: 'timestamp',
    label: 'CreatedAt',
    sortForm: {
      createdAt: {
        type: 'sort',
        value: 'ASC',
      },
    },
  },
  createdBy: {
    name: {
      type: 'string',
      label: 'CreatedBy',
      sortForm: {
        createdBy: {
          type: 'group',
          fields: {
            name: {
              type: 'sort',
            },
          },
        },
      },
      filterForm: {
        name: {
          label: 'Name',
          type: 'text',
          value: null,
          placeholder: 'name placeholder',
          errorMessage: null,
        },
        submit: {
          type: 'submit',
          label: 'Uložit',
        },
      },
    },
  },
  attachments: {
    type: 'image',
    label: 'Image',
  },
  isPublished: {
    type: 'boolean',
    label: 'Is published',
  },
  content: {
    type: 'string',
    label: 'Content',
    sortForm: {
      content: {
        type: 'sort',
      },
    },
    filterForm: {
      content: {
        label: 'Kontent',
        type: 'text',
        value: null,
        placeholder: 'Obsah',
        errorMessage: null,
      },
      submit: {
        type: 'submit',
        label: 'Uložit',
      },
    },
  },
};

const data = [...Array(50)].map((_, i) => ({
  id: i,
  content: 'some content',
  createdAt: 1593520437,
  createdAtFormatted: '1.1.2001',
  createdBy: { id: 1, name: 'Joe' },
  isPublished: true,
  attachments: [
    {
      alt: 'some Alt #1',
      key: 'some key #1',
      src:
        // eslint-disable-next-line max-len
        'data:image/jpeg;base64,',
    },
    {
      alt: 'some Alt #2',
      key: 'some key #2',
      src:
        // eslint-disable-next-line max-len
        'data:image/jpeg;base64,',
    },
  ],
}));

export const Basic = () => {
  const [selected, setSelected] = useState<number>();
  const [colState, setColState] = useState<any>(columns);

  return (
    <DataTable
      columns={boolean('no columns', false) ? {} : colState}
      data={boolean('no data', false) ? [] : data}
      labels={{
        empty: text('empty label', ''),
      }}
      isLoading={boolean('loading', false)}
      onRowSelect={(row) => (row.id === selected ? setSelected(undefined) : setSelected(row.id))}
      isRowSelected={(row) => selected === row.id}
      isKeyboardSelect={boolean('keyboard selection', true)}
      onColumnsChange={(c) => {
        setColState(c);
        action('columns changed')(c);
      }}
      {...(boolean('row expanding', false)
        ? {
            expandedRowRender: (row) => (row.id % 2 ? <div>yo</div> : undefined),
          }
        : {})}
    />
  );
};

export default {
  title: 'Components/DataTable',
  decorators: [withKnobs],
};
